import 'semantic-ui-css/semantic.min.css'
import Layout from '../components/Layout';

// This default export is required in a new `pages/_app.js` file.
export default function MyApp({ Component, pageProps }) {
    return (
    <Layout>
        <Component {...pageProps} />
    </Layout>)
  }
